import { NavLink }  from "react-router-dom";


function Navbar(){

const linkstyle=({isActive})=>({
    
        margin:"10px",
        textdecration:"none",
        color:isActive ? "blue" : "black",
        fontWeight:isActive ? "bold" : "normal"
    
});
return (
    <nav>
        <NavLink to="/home" style={linkstyle}>Home</NavLink>
        <NavLink to="/products" style={linkstyle}>Product</NavLink>
        <NavLink to="/orders" style={linkstyle}>Orders</NavLink>
        <NavLink to="/cart" style={linkstyle}>Cart</NavLink>
        <Navlink to="/setting" style={linkstyle}>Setting</Navlink>
        <NavLink to="/reports" style={linkstyle}>Reports</NavLink>
        <NavLink to="/profile" style={linkstyle}>Profile</NavLink>
        <NavLink to="/login" style={linkstyle}>Login</NavLink>
    </nav>
)

}

export default Navbar;
